import React from 'react';
import PropTypes from 'prop-types';

CityListItem.propTypes = {
  cityList: PropTypes.array,
};

CityListItem.defaultProps = {
  cityList: [],
};

const path = '../../assets/images/hotel_2.jpg';

function CityListItem(props) {
  const {cityList} = props;
  return (
    <>
      {cityList.map((city) => (
        <div key={city.name} className='cityList__item'>
          <img src='../../assets/images/hotel_detail_1.jpg' alt={city.name} />
        </div>
      ))}
    </>
  );
}
export default CityListItem;
